import {
  Container,
  Row,
  Col,
  Alert,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";
import ScrollReveal from "scrollreveal";

class MeetAna extends React.Component {
  componentDidMount() {}

  render() {
    return (
      <div>
        <Row>
          <Col sm={12} md={6} lg={6} xl={6}></Col>
          <Col sm={12} md={6} lg={6} xl={6}>
            <a href="https://imgur.com/ociFUp7">
              <img
                style={{ width: "100%" }}
                src="https://i.imgur.com/ociFUp7.png"
                title="source: imgur.com"
              />
            </a>
          </Col>
        </Row>
      </div>
    );
  }
}

export default MeetAna;
